import React, { useContext, useState } from 'react';
import { LoginContext } from '../components/LoginProvider';
import { Button, Form } from 'react-bootstrap';

function LoginRegister() {
  const { authenticateUser } = useContext(LoginContext);
  const [Loginemail, setLoginEmail] = useState("");
  const [Loginpassword, setLoginPassword] = useState("");
  const [Registeremail, setRegisterEmail] = useState("");
  const [Registerpassword, setRegisterPassword] = useState("");
  const [RegisterVerifypassword, setRegisterVerifyPassword] = useState("");
  const [showRegisterModal, setShowRegisterModal] = useState(false);
  const { registerUser } = useContext(LoginContext);
  const [name, setRegisterName] = useState("");
  const [surname, setRegisterSurname] = useState("");

  const handleLogin = (e) => {
    e.preventDefault();
    authenticateUser(Loginemail, Loginpassword);
  };

  const handleRegister = (e) => {
    e.preventDefault();
    registerUser(name, surname, Registerpassword, Registeremail);
    onHide();
  };



  return (
    <div className="login">
      <h2>Login</h2>
      <Form onSubmit={handleLogin}>
        <Form.Group controlId="Email">
          <Form.Label>Email:</Form.Label>
          <Form.Control type="email" value={Loginemail} onChange={(e) => setLoginEmail(e.target.value)} required />
        </Form.Group>
        <Form.Group controlId="Password">
          <Form.Label>Password:</Form.Label>
          <Form.Control type="password" value={Loginpassword} onChange={(e) => setLoginPassword(e.target.value)} required />
        </Form.Group>
        <Button type="submit">Login</Button>
      </Form>
      <Button onClick={() => setShowRegisterModal(true)}>Register</Button>
      <Modal show={show} onHide={onHide}>
      <Form onSubmit={handleRegister}>
        <Modal.Header closeButton>
          <Modal.Title>Register</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form.Group controlId="Name">
            <Form.Label>Name:</Form.Label>
            <Form.Control type="text" value={name} onChange={(e) => setRegisterName(e.target.value)} required />
          </Form.Group>
          <Form.Group controlId="Name">
            <Form.Label>Surname:</Form.Label>
            <Form.Control type="text" value={surname} onChange={(e) => setRegisterSurname(e.target.value)} required />
          </Form.Group>
          <Form.Group controlId="Name">
            <Form.Label>e-mail:</Form.Label>
            <Form.Control type="text" value={Registeremail} onChange={(e) => setRegisterEmail(e.target.value)} required />
          </Form.Group>
          <Form.Group controlId="Name">
            <Form.Label>Password:</Form.Label>
            <Form.Control type="text" value={Registerpassword} onChange={(e) => setRegisterPassword(e.target.value)} required />
          </Form.Group>
          <Form.Group controlId="Name">
            <Form.Label>Verify Password:</Form.Label>
            <Form.Control type="text" value={RegisterVerifypassword} onChange={(e) => setRegisterVerifyPassword(e.target.value)} required />
          </Form.Group>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={onHide}>Close</Button>
          <Button variant="primary" type="submit">Register</Button>
        </Modal.Footer>
      </Form>
    </Modal>
    </div>
  );
}

export default LoginRegister;
